import React from 'react';
import {PuffLoader} from "react-spinners";

const style = {
	width: "100%",  
	height: "100",
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
}

function Loader(props) {

	return (

      <PuffLoader style={style} loading={true}/>
	);
}

export default Loader
